import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {
      string: 'hello Anny'
    }
  }
  render(){
    return(
      <div className = 'App'>
      <p>{ this.state.string }</p>
      <button>Change Text</button>
      </div>
    );
  }
}

export default App;
